const colors = {
  brandColor: '#1ed760',
  yellow: '#EAD50F',
  backgroundColor: 'white',
  fontColor: '#222',
  gray: '#888',
  white: '#fff',
};

const styles = {
  colors,
  boxShadow: '0 4px 12px 0 rgba(0, 0, 0, .06)',
};

export default styles;
